import React from 'react'




const CollectionPreview = ({title,items }) => {
  console.log(items)
  return (
    <div>
      <h1>{title}</h1>
      <div className="preview">
        {
          items.filter((item,index) => index <=3).map(item => {
            return(
              <div key={item.id}>{item.name}</div> 
            )
          })
        }
      </div>
    </div>
  )
}

export default CollectionPreview;
